        var ans = confirm(""Do you want to delete territory with Territory Id: "" + territoryid);

        if (ans) {
            $.ajax({
                type: ""POST"",
                url: ""/Territories/Delete/"" + territoryid,
                success: function () {
                    window.location.href = ""/Territories/Index"";
                }
            })
        }
